contracts/Locker.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity 0.8.18;

contract Locker{

    // 
    // Events
    // 

    // 
    // Variables
    // 
    mapping(address=> uint256) internal  _locks;


    // 
    // Methods
    // 

    constructor(){}
    //Okuma için kullanılan fonksiyon
    function getEtherLock(address user) public  view returns (uint256){
        return  _locks[user];
    }
    // Parayı kitlemek için kullanılan fonksiyon.
    function depositEther() public payable{
        require(msg.value> 0,"insufficient  deposit");
        _locks[msg.sender] += msg.value;
    }

    // Kilit açıp parayı çekmek için kullanılan fonksiyon.

    function reedemEether(uint256 amount)public {
        require(
            getEtherLock(msg.sender) >= amount,
            "insufficient  deposit"
        );

        payable (msg.sender).transfer(amount);
        _locks[msg.sender] -=amount;
    }
}

